  const map = new ol.Map({
    target: 'map',
    layers: [
      new ol.layer.Tile({ source: new ol.source.OSM() }),
    ],
    view: new ol.View({
      center: ol.proj.fromLonLat([46.71, 24.71]),
      zoom: 10
    })
  });

  // Population layer
  const popLayer = new ol.layer.Vector({
    source: new ol.source.Vector({
      features: new ol.format.GeoJSON().readFeatures(popGrid, {
        featureProjection: 'EPSG:3857'
      })
    }),
    style: feature => {
      const value = feature.get("PCNT") || 0;
      let color = value > 1000 ? "#b71c1c" :
                  value > 500 ? "#ef5350" :
                  value > 250 ? "#ffb300" :
                  value > 100 ? "#fff176" : "#fffde7";
      return new ol.style.Style({
        fill: new ol.style.Fill({ color }),
        stroke: new ol.style.Stroke({ color: "#444", width: 0.3 })
      });
    },
    opacity: 0.6
  });
  map.addLayer(popLayer);

  // Facility layer
  const facilitySource = new ol.source.Vector();
  const facilityLayer = new ol.layer.Vector({ source: facilitySource });
  map.addLayer(facilityLayer);

  function renderFacilities(selectedType) {
    facilitySource.clear();
    facilities.forEach(fac => {
      if (selectedType === "All" || fac.type === selectedType) {
        const feature = new ol.Feature({
          geometry: new ol.geom.Point(ol.proj.fromLonLat(fac.coords))
        });
        feature.setStyle(new ol.style.Style({
          image: new ol.style.Circle({
            radius: 6,
            fill: new ol.style.Fill({ color: "#1976D2" }),
            stroke: new ol.style.Stroke({ color: "#fff", width: 1 })
          }),
          text: new ol.style.Text({
            text: fac.name,
            offsetY: -15,
            font: "10px sans-serif",
            fill: new ol.style.Fill({ color: "#000" }),
            stroke: new ol.style.Stroke({ color: "#fff", width: 2 })
          })
        }));
        facilitySource.addFeature(feature);
      }
    });
  }

  // Initial render
  renderFacilities("All");

  // Dropdown interaction
  document.getElementById("facilitySelect").addEventListener("change", function() {
    const selected = this.value;
    renderFacilities(selected);
  });
</script>
